import './App.css';
import AddMovie from './components/AddMovie';
import Footer from './components/Footer';
import Header from './components/Header';
import Movies from './containers/movies';

function App() {
  return (
    <>
      <Header/>
      <Movies/>
      <AddMovie/>
      <Footer/>
    </>
  );
}

export default App;
